(206, 2, 698687, 'Transformers One', 'The untold origin story of Optimus Prime and Megatron, better known as sworn enemies, but once were friends bonded like brothers who changed the fate of Cybertron forever.', 814.83, '2024-09-11', 8.1, 'https://image.tmdb.org/t/p/original//uMXVeVL2v57lMv6pqBmegDHHPqz.jpg', 'https://image.tmdb.org/t/p/original//qbkAqmmEIZfrCO8ZQAuIuVMlWoV.jpg', 1, '2024-11-30 04:10:00', '2024-11-30 04:11:33'),
(207, 2, 1184918, 'The Wild Robot', 'After a shipwreck, an intelligent robot called Roz is stranded on an uninhabited island. To survive the harsh environment, Roz bonds with the island\'s animals and cares for an orphaned baby goose.', 1442.21, '2024-09-12', 8.399, 'https://image.tmdb.org/t/p/original//v9acaWVVFdZT5yAU7J2QjwfhXyD.jpg', 'https://image.tmdb.org/t/p/original//wTnV3PCVW5O92JMrFvvrRcV39RU.jpg', 1, '2024-11-30 04:11:50', '0000-00-00 00:00:00'),
(208, 2, 24428, 'The Avengers', 'When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!', 121.999, '2012-04-25', 7.722, 'https://image.tmdb.org/t/p/original//9BBTo63ANSmhC4e6r62OJFuK2GL.jpg', 'https://image.tmdb.org/t/p/original//RYMX2wcKCBAr24UyPD7xwmjaTn.jpg', 1, '2024-11-30 04:12:19', '0000-00-00 00:00:00'),
(209, 2, 425, 'Ice Age', 'With the impending ice age almost upon them, a mismatched trio of prehistoric critters ‚Äì Manny the woolly mammoth, Diego the saber-toothed tiger and Sid the giant sloth ‚Äì find an orphaned infant and decide to return it to its human parents. Along the way, the unlikely allies become friends but, when enemies attack, their quest takes on far nobler aims.', 107.757, '2002-03-10', 7.4, 'https://image.tmdb.org/t/p/original//8pwIhymsxfAVjrAE7syDjQULn37.jpg', 'https://image.tmdb.org/t/p/original//gLhHHZUzeseRXShoDyC4VqLgsNv.jpg', 0, '2024-11-30 04:12:40', '0000-00-00 00:00:00'),
(210, 2, 820232, 'Demon Slayer: Kimetsu no Yaiba ‚Äì Sibling\'s Bond', 'A recap of Kimetsu no Yaiba episodes 1‚Äì5, with new footage and special end credits. Tanjiro Kamado returns home to find his family slaughtered and the lone survivor, his sister Nezuko, turned into a Demon. To his surprise, however, Nezuko still shows signs of human emotion and thought. Thus begins Tanjiro\'s journey to seek out the Demon who killed their family and turn his sister human again.', 69.197, '2019-03-29', 7.9, 'https://image.tmdb.org/t/p/original//8NEvnVKeGMLEXG45MMNqxJLcM4y.jpg', 'https://image.tmdb.org/t/p/original//vJUDoYNNKvBqbEPUskgvzPXGEFz.jpg', 1, '2024-11-30 04:12:59', '0000-00-00 00:00:00'),
(211, 2, 13053, 'Bolt', 'Bolt is the star of the biggest show in Hollywood. The only problem is, he thinks it\'s real. After he\'s accidentally shipped to New York City and separated from Penny, his beloved co-star and owner, Bolt must harness all his \"super powers\" to find a way home.', 49.304, '2008-11-21', 6.519, 'https://image.tmdb.org/t/p/original//uWIyXlBRwW2MIBcBysj50A9nv7D.jpg', 'https://image.tmdb.org/t/p/original//z9VHoUcZ1GiH3f3qYz7Me7Zc1Fd.jpg', 1, '2024-11-30 04:13:16', '0000-00-00 00:00:00'),
(213, 2, 516486, 'Greyhound', 'A first-time captain leads a convoy of allied ships carrying thousands of soldiers across the treacherous waters of the \"Black Pit\" to the front lines of WWII. With no air cover protection for 5 days, the captain and his convoy must battle the surrounding enemy Nazi U-boats in order to give the allies a chance to win the war.', 51.74, '2020-07-09', 7.4, 'https://image.tmdb.org/t/p/original//xXBnM6uSTk6qqCf0SRZKXcga9Ba.jpg', 'https://image.tmdb.org/t/p/original//kjMbDciooTbJPofVXgAoFjfX8Of.jpg', 1, '2024-11-30 04:13:58', '0000-00-00 00:00:00'),
(214, 2, 82700, 'After Earth', 'One thousand years after cataclysmic events forced humanity\'s escape from Earth, Nova Prime has become mankind\'s new home. Legendary General Cypher Raige returns from an extended tour of duty to his estranged family, ready to be a father to his 13-year-old son, Kitai. When an asteroid storm damages Cypher and Kitai\'s craft, they crash-land on a now unfamiliar and dangerous Earth. As his father lies dying in the cockpit, Kitai must trek across the hostile terrain to recover their rescue beacon. His whole life, Kitai has wanted nothing more than to be a soldier like his father. Today, he gets his chance.', 26.221, '2013-05-30', 5.191, 'https://image.tmdb.org/t/p/original//958IEMxVqU3FFOdZll3PcFLoyef.jpg', 'https://image.tmdb.org/t/p/original//iXMvYIlzzJBs352CfeiQcBvovZt.jpg', 1, '2024-11-30 04:14:38', '0000-00-00 00:00:00'),
(215, 2, 920, 'Cars', 'Lightning McQueen, a hotshot rookie race car driven to succeed, discovers that life is about the journey, not the finish line, when he finds himself unexpectedly detoured in the sleepy Route 66 town of Radiator Springs. On route across the country to the big Piston Cup Championship in California to compete against two seasoned pros, McQueen gets to know the town\'s offbeat characters.', 55.327, '2006-06-08', 7, 'https://image.tmdb.org/t/p/original//sd4xN5xi8tKRPrJOWwNiZEile7f.jpg', 'https://image.tmdb.org/t/p/original//abW5AzHDaIK1n9C36VdAeOwORRA.jpg', 1, '2024-11-30 04:14:58', '0000-00-00 00:00:00'),
(216, 2, 8587, 'The Lion King', 'Young lion prince Simba, eager to one day become king of the Pride Lands, grows up under the watchful eye of his father Mufasa; all the while his villainous uncle Scar conspires to take the throne for himself. Amid betrayal and tragedy, Simba must confront his past and find his rightful place in the Circle of Life.', 139.132, '1994-06-24', 8.3, 'https://image.tmdb.org/t/p/original//wXfAvsPZqBDJ8U78F2IAzsUxtNh.jpg', 'https://image.tmdb.org/t/p/original//sKCr78MXSLixwmZ8DyJLrpMsd15.jpg', 1, '2024-11-30 04:19:52', '0000-00-00 00:00:00');
